const Home = () => {


  return (
    <div className="home">
      <font size={48}>
        <h1 class="display-1" id="titleair" style={{ userSelect: "none" }}>
          Air&#10;Planes
        </h1>
      </font>
      <div className="dropdown" style={{marginTop:"35rem"}}>
        <button className="btn btn-primary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
      Go to
        </button>
          <ul className="dropdown-menu">
            <li><a class="dropdown-item" href="legende">Legende</a></li>
            <li><a class="dropdown-item" href="istorie">Istorie</a></li>
            <li><a class="dropdown-item" href="#">Something else here</a></ li>
          </ul>
        </div>
    </div>
  );
};

export default Home;
